import React, {useState, useMemo} from 'react';

const Row = ({data}) => {

	

	return(		    
    	<tr key={data.id}>
	    	<td>{data.id}</td>
	    	<td>{data.title}</td>
	    	<td>{data.completed}</td>
	    	<td><button>Delete</button></td>
    	</tr>	    
	)
	
}

export default Row;
